/**
 * @suppress
 */
public object FfiConverterTypeVoiceClient: FfiConverter<VoiceClient, Pointer> {

    override fun lower(value: VoiceClient): Pointer {
        return value.uniffiClonePointer()
    }

    override fun lift(value: Pointer): VoiceClient {
        return VoiceClient(value)
    }

    override fun read(buf: ByteBuffer): VoiceClient {
        // The Rust code always writes pointers as 8 bytes, and will
        // fail to compile if they don't fit.
        return lift(Pointer(buf.getLong()))
    }

    override fun allocationSize(value: VoiceClient) = 8UL

    override fun write(value: VoiceClient, buf: ByteBuffer) {
        // The Rust code always expects pointers written as 8 bytes,
        // and will fail to compile if they don't fit.
        buf.putLong(Pointer.nativeValue(lower(value)))
    }
}



