/**
 * Error type exposed to Kotlin via UniFFI
 */
sealed class VoiceCoreException: kotlin.Exception() {
    
    class Database(
        
        val `msg`: kotlin.String
        ) : VoiceCoreException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class Config(
        
        val `msg`: kotlin.String
        ) : VoiceCoreException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class Sync(
        
        val `msg`: kotlin.String
        ) : VoiceCoreException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class Validation(
        
        val `msg`: kotlin.String
        ) : VoiceCoreException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    
    class Io(
        
        val `msg`: kotlin.String
        ) : VoiceCoreException() {
        override val message
            get() = "msg=${ `msg` }"
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<VoiceCoreException> {
        override fun lift(error_buf: RustBuffer.ByValue): VoiceCoreException = FfiConverterTypeVoiceCoreError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeVoiceCoreError : FfiConverterRustBuffer<VoiceCoreException> {
    override fun read(buf: ByteBuffer): VoiceCoreException {
        

        return when(buf.getInt()) {
            1 -> VoiceCoreException.Database(
                FfiConverterString.read(buf),
                )
            2 -> VoiceCoreException.Config(
                FfiConverterString.read(buf),
                )
            3 -> VoiceCoreException.Sync(
                FfiConverterString.read(buf),
                )
            4 -> VoiceCoreException.Validation(
                FfiConverterString.read(buf),
                )
            5 -> VoiceCoreException.Io(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: VoiceCoreException): ULong {
        return when(value) {
            is VoiceCoreException.Database -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is VoiceCoreException.Config -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is VoiceCoreException.Sync -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is VoiceCoreException.Validation -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
            is VoiceCoreException.Io -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.`msg`)
            )
        }
    }

    override fun write(value: VoiceCoreException, buf: ByteBuffer) {
        when(value) {
            is VoiceCoreException.Database -> {
                buf.putInt(1)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is VoiceCoreException.Config -> {
                buf.putInt(2)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is VoiceCoreException.Sync -> {
                buf.putInt(3)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is VoiceCoreException.Validation -> {
                buf.putInt(4)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
            is VoiceCoreException.Io -> {
                buf.putInt(5)
                FfiConverterString.write(value.`msg`, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}




